import React, {useState, useEffect} from 'react';
import axios from 'axios';


function App() {

  const baseUrl="https://localhost:44370/api/usuarios";
  const [data, setData] = useState([]);

  const peticionGet=async()=>{
    await axios.get(baseUrl)
    .then(response=>{
      setData(response.data);
      console.log(data);
    }).catch(error=>{
      console.log(error);
    });
  }

  useEffect(()=>{
    peticionGet();
  },[])

  return (
    <div className="App">
    <table>
      <thead>
        <tr>
          <th>Id</th>
          <th>Nombres</th>
          <th>direccion</th>
          <th>Telefono</th>
          <th>Email</th>
          <th>Edad</th>
          <th>Rol</th>
          <th>Permiso</th>
          <th></th>
        </tr>
      </thead>
      <tbody>
        {data.map(usuario=>(
          <tr key={usuario.idUsuario}>
            <td>{usuario} </td>
            {/* <td>{usuario.direccion}</td>
            <td>{usuario.telefono}</td>
            <td>{usuario.email}</td>
            <td>{usuario.edad}</td>
            <td>{usuario.rol}</td>
            <td>{usuario.permiso}</td> */}
            <td>
              <button>Editar</button>
              <button>Eliminar</button>
            </td>
          </tr>
        )) }
      </tbody>
    </table>
    </div>
  );
}

export default App;
